import React from 'react';
import './contact.css';
import { FaGithubSquare } from "react-icons/fa";

const Contact = () => {
    return (
        <section id='contact'>
            <h2 className='contacttitle'> Contact me</h2>
            <span className='contactinfo'> if you want to contact me click on the website you want</span>
            <br></br>
            <br></br>
            <div className='barcontact'>
                <a> href='https://example.com' target='blan'
                    <FaGithubSquare size={100}></FaGithubSquare>
                </a>
            </div>
        </section>
    )
}

export default Contact;
